import React, {useState} from "react";
import projects from "./projects.json";

const Projects = () => {

    return <>
		<div id="projects">
			<h2>Projects</h2>
			{
				projects.map((project, index) => (
					<div key={index}>
						<h4>{project.name}</h4>
						<small>{project.Language}</small>
						<ul>
							{project.description.map((a) => <li>{a}</li>)}
						</ul>
					</div>
				))
			}
		</div>
    </>
}

export default Projects
